import React, {Component} from 'react';
import TicTacItem from "./components/TicTacItem";
import GameDiv, {GameDivProps} from "./components/GameDiv";
function f(e:any):void{
    console.log(e);
}
class App extends Component {
    render() {
        return (
            <div
                style={{
                    display:'flex',
                    justifyContent:'center',
                    alignItems:'center',
                    width:'100%',
                    height:'100%',
                    top:'0',
                    left:'0',
                    position:'fixed'

                }}
            >
                <GameDiv><TicTacItem onClick={()=>{console.log('hi')}} onMouseEnterFunc={()=>{f(this)}}/>
                </GameDiv>
            </div>
        );
    }
}

export default App;
